import React from "react";
import { Link } from "react-router-dom";

const Routings = () => {
  return (
    <div>
      <Link to="/">Show</Link>
      <Link to="/Add">Add</Link>

      <Link to="/Update">Update</Link>
    </div>
  );
};

export default Routings;
